function draw() {
	
	//game
	if (!gameOver) {
		
		//black background
		background(0);

		//drop bananas
		if (frameCount % frequency == 0) {
			append (bananas, new Banana (monkey.x));
		}
		
		//call show & move monkey functions
		monkey.show();
		monkey.move();
		
		//execute Banana methods
		for (var i = 0; i < bananas.length; i++) {
			bananas[i].show();
			bananas[i].move();
			bananas[i].hitPaddle();
		}
		
		//increase banana drop frequency
		for (var i = bananas.length -1; i >= 0; i--) {
			if (bananas[i].unCaught == false) {
				bananas.splice (i, 1);
				score++;
				if (score % 5 == 0) {
					if (frequency >= 20) {
						frequency -= 2;
					}
				}

			}
		}
		
		//delete bananas from object array
		for (var i = bananas.length -1; i >= 0; i--) {
			if (bananas[i].y > height) {
				bananas.splice (i, 1);
				lives--;
				if (lives == 0) {
					gameOver = true;
					if (!showButtons) {
						button.show();
						input.show();
						showButtons = true;
					}

				}
			}
		}


		basket.show();
		fill (255);
		textSize (20);
		text ("Score: " + score, 50, 50);
		text ("Lives: " + lives, 300, 50);
	}
	
	//game over screen
	if (gameOver) {
		background (0);
		textSize (25);
		text ("GAME OVER", 125, 200);
		text ("Score: " + score, 150, 230);
	}

	if (scoreboard) {
		background (0);
		fill (255);
		text ("High Scores", 125, 25);
		text ("Name", 50, 60);
		text ("Score", 300, 60);
		for (var i = 0; i < 10; i++) {
			text (scoreArray[i].name, 50, 100 + i * 25);
			text (scoreArray[i].score, 300, 100 + i * 25);
		}

	}
}

var Basket = function () { 
	this.h = 20;
	this.w = 50
	this.y = height - this.h;
	
	this.show = function () {
		image (basketImage, mouseX, this.y, this.w, this.h);
	}
	
}



var Banana = function (x) {
	
	this.x = x;
	this.d = 20;
	this.y = this.d/2;
	this.speed = 2;
	this.unCaught = true;
	
	this.show = function () {
		image (bananaImage, this.x , this.y, this.d, this.d);
	}
	
	this.move = function () {
		this.y += this.speed;
	}
	
	this.hitPaddle = function () {
		if (this.y > 370) {
			if (this.x > mouseX - basket.w/2) {
				if (this.x < mouseX + basket.w/2) {
					catchSound.play();
					this.unCaught = false;
				}
			}
		}
	}
}

var Monkey = function (x) {
	this.x = x;
	this.monkeySpeed = 3;
	
	this.show = function () {
		image (monkeyImage, this.x, 0, 40, 40);
	}
	
	this.move = function () {
		this.x += this.monkeySpeed;
		if (random() < .05) {
			this.monkeySpeed *= -1;
		}
		if (this.x > width - 10) {
			this.monkeySpeed = abs(this.monkeySpeed) * -1;
		}
		if (this.x < 10) {
			this.monkeySpeed = abs(this.monkeySpeed);
		}	
	}
}

